  \"2015-05-07T03:47:05.967162\",\n\t\"name\": \"improved-design-and-data-accuracy-through-modeling-and-simulation-of-wind-tunnel-facilitie\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Analytical Services &amp; Materials, Inc.
  (AS&amp;M) is proposing to develop and validate the procedures and modeling necessary
  to simulate, using computational fluid dynamics (CFD), an entire wind tunnel circuit.
  \ The application of CFD in wind tunnel circuit analysis is in its infancy and its
  use would allow for the design of better facilities and the development of better
  modifications of existing facilities to improve their efficiency and expand their
  capability.  A better understanding of the facility flow characteristics obtained
  by the simulation would improve wall correction methodology and data accuracy from
  the facility.  The proposed Phase I program will validate the methods against calibration
  data from the NASA Langley 14 x 22-ft Low-Speed Tunnel.\",\n\t\"license_title\":
